import React from 'react';

import styled from "styled-components";
import { AiOutlineCamera } from 'react-icons/ai';


const H = styled.div `
    text-align:left;
    width:100%;
    height:60px;
    background-color: #343a40;;
    font-size: 20;
    padding: 10px; /* 내부 여백 설정 */
    color: white;
    `
    const Wrapper=styled.div`
    text-align:left;
    width:100%;
    height:60px;
    padding: 10px; /* 내부 여백 설정 */
    color: white;
    `


const Header = () => {
    return (
        <>
        <Wrapper>
             <AiOutlineCamera/>
        </Wrapper>

        <H>
            <h1>album</h1>
        </H>
        </>
    );
};

export default Header;
